import React from 'react'
import "./Navbar.css"
import Link from '../Link/Link'

const Navbar = () => {

  const links = [{id:1, name:"home"}, {id:2, name:"about"}, {id:3, name:"product"}, {id:4, name:"contact us"}, {id:5, name:"contact"}]
  return (

    <div>
      <nav>
        <div><img src='./Exlogo.png' alt='logo' /></div>
        {links.map(link => <Link key={link.id} name = {link.name}/>)}
      </nav>

    </div>

  )
}

export default Navbar
